import React from 'react'

export default function XlArticle(props) {
    return (
        <div className="XlArticle"><a href={props.link}>
            <div className="XlImg"><img src={props.imgURL} alt="" srcSet=""/></div>
            <div className="XLheadline">{props.headline}</div>
            </a></div>
    )
}
